class BookingStructure extends Component {
    constructor(props) {
        super(props);

        this.state = {
        }
    }

    componentDidMount() {
        this.setState({ moviedates: this.props.moviedates })
    }


    render() {
        console.log(typeof this.props.moviedates)
        console.log(this.props.moviedates)
        console.log(typeof this.state.moviedates)
        console.log(this.state.moviedates)
        return (
            <tbody>
                {this.state.moviedates ? this.state.moviedates.map((moviedate) =>

                    <tr>
                        <td>
                            {moviedate.Movietitle}
                        </td>
                        <td>
                            {moviedate.Salon}
                        </td>
                        <td>
                            {moviedate.Date}
                        </td>
                        <td>
                            {moviedate.TicketsLeft}
                        </td>
                        <td>
                            &nbsp;
                        </td>
                    </tr>)
                    :
                    <tr>
                        <td>
                            Hej
                        </td>
                    </tr>
                }
            </tbody>
        )
    }

}


export default BookingStructure;
